    class Program
    {
        
        static string twoStrings(string s1, string s2)
        {
            bool find = false;
            for (int i = 1; i < 2; i++)
            {
                List<string> substrings1 = createSubstrings(s1, i);

                var ht1 = new Hashtable(substrings1.GroupBy(g => g).ToDictionary(x => x.Key, x => x.Count()));
                if (i < s2.Length)
                {
                    for (int k = 0; k < s2.Length; k++)
                    {
                        if ((s2.Length - i) >= k)
                            if (ht1.ContainsKey(s2.Substring(k, i)))
                                find = true;
                    }
                }
                else
                {
                    return "No";
                }          
                if (find)
                    return "Yes";
            }

            return "No";
        }

        static List<string> createSubstrings(string s, int substrLen)
        {
            List<string> l = new List<string>();
            int z = 1;
            for (int i = 0; i < s.Length; i++)
            {
                if ((s.Length - substrLen) >= i)
                    l.Add(s.Substring(i, substrLen));              
            }
            return l;
        }


